import { FormControl, InputLabel, OutlinedInput } from "@mui/material";

const LoginForm = () => {
  return (
  <FormControl>
    <OutlinedInput id="username" aria-describedby="username" required placeholder="Username"/>
  </FormControl>
  );
};

export default LoginForm;
